import React from 'react'
import Search from '../Search/Search'

const Pokedex = () => {
  return (
    <div className='flex flex-col w-[1000px]'>
      <h1 className='mx-auto font-bold text-3xl mb-[30px] gap-'>Pokedex</h1>
      <Search/>
    </div>
  )
}

export default Pokedex
